import "./style/noteitem.css";

export default function Noteitem({ task }) {
  return (
    <div className='card_container'>
      <div className='title'>
        <p>{task.title}</p>
      </div>
      <p className='descritpion'>task descritpion</p>
      <p className='date'>task end data</p>
    </div>
  );
}
